  CONSTRAINT `FK_tbl_sales_payment_tbl_sales_invoice` FOREIGN KEY (`invoice_id`) REFERENCES `tbl_sales_invoice` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB  DEFAULT CHARSET=latin1;

